sys_hub_input_scripts.script:
{"ator":{"scriptActive":true,"script":"/*
**Access Flow/Action data using the fd_data object. Script must return a value. 
**Order number is offset by +1 in Error Handling Section.
**Available options display upon pressing "." after fd_data
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
*/

var arrayAtor = fd_data._1__diretor.ator;

if(!arrayAtor){
 return;
}

var ator = arrayAtor.split(",");

for (var i = 0; i < ator.length; i++) {
 var item = ator[i].trim();

 var existingRecord = new GlideRecord('x_1300284_raposa_0_ator');
 existingRecord.addQuery('ator', item);
 existingRecord.query();

 if (!existingRecord.next()) {
 var gr = new GlideRecord('x_1300284_raposa_0_ator');
 gr.initialize();
 gr.ator = item;
 gr.insert();
 }
}"}}

